"use strict";function gameLoaded(){console.log("Game Ready!"),window.top.postMessage("Game Load Done","*")}function gameEnd(){console.log("End of Game")}function startDancing(){play(parseInt(battleNum),crew)}function play(e,n){var a;null!=unity?(a={lv:e,ids:n},unity.SendMessage("GameManager","Play",JSON.stringify(a))):console.error("unity is null, please wait until webGL loaded")}function end(e){null!=unity?unity.SendMessage("GameManager","OnGameResultReceive","".concat(e)):console.error("unity is null, please wait until webGL loaded")}function reset(){null!=unity?unity.SendMessage("GameManager","ResetGame"):console.error("unity is null, please wait until webGL loaded")}